(1884, 239, 'about_solution_title', '<h2>About <strong>Alpha Alias</strong></h2>'),
(1885, 239, '_about_solution_title', 'field_5d09f41c76510'),
(1886, 239, 'about_solution_description', 'Alpha Alias is a Helsinki, Finland based digital agency focused on operational leadership.  At Alpha Alias we believe innovation is the defiance of normal. Our ‘Project First’ approach allows unique product requirements to define the specialized needs of a project team before we enlist them. We apply that approach to digital operations.'),
(1887, 239, '_about_solution_description', 'field_5d09f42f76511'),
(1888, 239, 'about_solution_preview', '269'),
(1889, 239, '_about_solution_preview', 'field_5d09f43e76512'),
(1890, 239, 'challenge_title', '<h2>About The Job</h2>'),
(1891, 239, '_challenge_title', 'field_5d09f39a7650b'),
(1892, 239, 'challenge_description', 'We are looking for a sales-driven, operational leader with strong expertise in the digital space.'),
(1893, 239, '_challenge_description', 'field_5d09f3a67650c'),
(1894, 239, 'challenge_content', '<p>This role requires the motivation of a proactive self-starter with a history of success in business development, project management and account leadership.</p><p>This role requires the motivation of a proactive self-starter with a history of success in business development, project management and account leadership.</p><p>This role requires the motivation of a proactive self-starter with a history of success in business development, project management and account leadership.</p><p>This role requires the motivation of a proactive self-starter with a history of success in business development, project management and account leadership.</p>'),
(1895, 239, '_challenge_content', 'field_5d09f3b27650d'),
(1896, 239, 'challenge_preview', '270'),
(1897, 239, '_challenge_preview', 'field_5d09f3c07650e'),
(1898, 239, 'solution_title', '<h2>Area Of Operation</h2>'),
(1899, 239, '_solution_title', 'field_5d09f35a76507'),
(1900, 239, 'solution_description', 'Alpha Alias is currently looking to expand into several markets. We are looking for localized support for business in those markets. We’re looking for you to drive leads in any way possible, from anywhere in the world, while also being responsible for all leads we provide to you in your market.'),
(1901, 239, '_solution_description', 'field_5d09f36476508'),
(1902, 239, 'solution_preview', '272'),
(1903, 239, '_solution_preview', 'field_5d09f37076509'),
(1904, 239, 'responsibilities_list', '<ul><li>Procure new business</li><li>Develop growth strategies and plans</li><li>Manage and maintain relationships with clients and stakeholders</li><li>Increase client base</li><li>Have an in-depth knowledge of business products and value proposition</li><li>Write business proposals</li><li>Negotiate with stakeholders</li><li>Identify and map business strengths and customer needs</li><li>Research business opportunities and viable income streams</li><li>Follow industry trends locally and internationally</li><li>Draft and review contracts</li><li>Report on successes and areas needing improvements</li></ul>'),
(1905, 239, '_responsibilities_list', 'field_5d09f47476514'),
(1906, 239, 'requirements_list', '<ul><li>Excellent presentation, communication and negotiation skills, with experience liaising with clients at senior level Strong experience in participating in new business procurement and activation</li><li>Demonstrable experience growing revenues and effectively managing budgets for large-scale projects</li><li>Experience motivating and running teams</li><li>Excellent organizational and time management skills with strong attention to detail</li><li>Excellent oral and written skills in English Excellent oral and written skills in your area’s native language(s)</li><li>History of success in creating project plans</li><li>History of success in closing digital sales Solid understanding of modern digital practices</li><li>Solid understanding of current digital trends</li></ul>'),
(1907, 239, '_requirements_list', 'field_5d09f49276516'),
(1908, 239, 'interview_process_title', '<h2>What To Expect</h2>'),
(1909, 239, '_interview_process_title', 'field_5d09f4bf76518'),
(1910, 239, 'interview_process_description', 'Our process for reviewing applications includes 3 people; our founder and two recruitment consultants. '),
(1911, 239, '_interview_process_description', 'field_5d09f4d276519'),
(1912, 239, 'interview_process_content', '<p>Together they will carefully consider all the information you have submitted to make sure you meet the job requirements. From there they will follow up via email if there are any questions or if they need anything clarified.</p><p>When a candidate feels right for the job we will reach out for a video chat interview. In that interview you can expect friendly and professional conversation with our founder.</p><p>He’ll ask you some questions about your history and he’ll be looking to see if you are a good fit to represent Alpha Alias in your market.</p><p>We will respond to everyone who takes the time to submit an application. Please keep in mind we are a small team so it may take some time. Please do not call us to follow up. If you have any questions please contact us at <a href=\"mailto:careers@alphaalias.com\">careers@alphaalias.com</a>.</p>'),
(1913, 239, '_interview_process_content', 'field_5d09f4e07651a'),
(1914, 239, 'interview_process_preview', '273'),
(1915, 239, '_interview_process_preview', 'field_5d09f4f27651b'),
(1916, 239, 'apply_solution_title', '<h2>How <strong>To Apply</strong></h2>'),
(1917, 239, '_apply_solution_title', 'field_5d09f5397651d'),
(1918, 239, 'apply_solution_decription', '<p>We look forward to reviewing your application! Please send the following to <a href=\"mailto:careers@alphaalias.com\">careers@alphaalias.com</a> when you are ready:</p>'),
(1919, 239, '_apply_solution_decription', 'field_5d09f5517651e'),
(1920, 239, 'applicants_list_title', 'The list for applicants to send'),
(1921, 239, '_applicants_list_title', 'field_5d09f5617651f'),
(1922, 239, 'applicants_list', '<ul><li>Resume / CV Attachment</li><li>Cover letter telling us a little about yourself as a person and as a professional</li><li>Some information about how you meet the requirements</li><li>Any additional information you would like to share about yourself or your approach to business development</li></ul>'),
(1923, 239, '_applicants_list', 'field_5d09f57076520'),
