(2040, 281, 'folder_full_description', 'We are looking for a sales-driven, operational leader with strong expertise in the digital space. This role requires the motivation of a proactive self-starter with a history of success in business development, project management and account leadership.'),
(2041, 281, '_folder_full_description', 'field_5d0a045c6b91f'),
