(4164, 448, 'folder_button_title', 'Learn How'),
(4165, 448, '_folder_button_title', 'field_5cee33d641eda'),
(4166, 448, 'folder_button_url', '17'),
(4167, 448, '_folder_button_url', 'field_5cee33e041edb'),
(4168, 448, 'our_approach_list_0_title', 'Project'),
(4169, 448, '_our_approach_list_0_title', 'field_5cf4ba46f411c'),
(4170, 448, 'our_approach_list_0_subtitle', 'Project First'),
(4171, 448, '_our_approach_list_0_subtitle', 'field_5cf4ba51f411d'),
(4172, 448, 'our_approach_list_0_description', '<p><span style=\"font-weight: 400;\">Challenging the idea of the traditional digital agency, Alpha Alias applies the Project First strategy to planning activity for your project from the very beginning. We plan the project first, which then outlines the deliverables and skill sets required. From there we decide who will be involved and how the activity will look.</span></p><p><span style=\"font-weight: 400;\">Alpha Alias leads projects as a service, and in doing so we are committed to the project, rather than to a proprietary team or product. We are able to bring more value to a project because our fundamental business principle is to drive successful projects end-to-end.</span></p>'),
(4173, 448, '_our_approach_list_0_description', 'field_5cf4ba56f411e'),
