(4381, 7, 'our_approach_subtitle', '<p><span style=\"color: #6715d1;\">Our Approach:</span> Project First</p>'),
(4382, 7, '_our_approach_subtitle', 'field_5d23a00e18b67'),
(4383, 7, 'our_approach_subtitle_link', 'a:3:{s:5:\"title\";s:8:\"Services\";s:3:\"url\";s:37:\"/news/insights/what-is-project-first/\";s:6:\"target\";s:0:\"\";}'),
(4384, 7, '_our_approach_subtitle_link', 'field_5d23a02418b68'),
(4385, 453, 'main_title', '<h1>Innovation <strong>= Defiance</strong> Of Normal</h1>'),
(4386, 453, '_main_title', 'field_5cee44aadbbd0'),
(4387, 453, 'title', ''),
(4388, 453, '_title', 'field_5cee2b06a869c'),
(4389, 453, 'slogan', 'Inspiration Fueled Action'),
(4390, 453, '_slogan', 'field_5cee33af41ed8'),
(4391, 453, 'folder_description', 'Alpha Alias challenges ordinary, allowing inspiration to drive our approach to digital products and services.'),
(4392, 453, '_folder_description', 'field_5cee33ba41ed9'),
(4393, 453, 'folder_button_title', 'Learn How'),
(4394, 453, '_folder_button_title', 'field_5cee33d641eda'),
(4395, 453, 'folder_button_url', '17'),
(4396, 453, '_folder_button_url', 'field_5cee33e041edb'),
(4397, 453, 'our_approach_list_0_title', 'Project'),
(4398, 453, '_our_approach_list_0_title', 'field_5cf4ba46f411c'),
(4399, 453, 'our_approach_list_0_subtitle', 'Project First'),
(4400, 453, '_our_approach_list_0_subtitle', 'field_5cf4ba51f411d'),
(4401, 453, 'our_approach_list_0_description', '<p><span style=\"font-weight: 400;\">Challenging the idea of the traditional digital agency, Alpha Alias applies the Project First strategy to planning activity for your project from the very beginning. We plan the project first, which then outlines the deliverables and skill sets required. From there we decide who will be involved and how the activity will look.</span></p><p><span style=\"font-weight: 400;\">Alpha Alias leads projects as a service, and in doing so we are committed to the project, rather than to a proprietary team or product. We are able to bring more value to a project because our fundamental business principle is to drive successful projects end-to-end.</span></p>'),
(4402, 453, '_our_approach_list_0_description', 'field_5cf4ba56f411e'),
(4403, 453, 'our_approach_list_1_title', 'Team'),
(4404, 453, '_our_approach_list_1_title', 'field_5cf4ba46f411c'),
(4405, 453, 'our_approach_list_1_subtitle', 'Organizing The Best'),
(4406, 453, '_our_approach_list_1_subtitle', 'field_5cf4ba51f411d'),
(4407, 453, 'our_approach_list_1_description', '<p><span style=\"font-weight: 400;\">As the project is being defined, we will gain a clear understanding of the deliverables and their nuances. Each deliverable will require specific skill sets at various levels of expertise. Alpha Alias works with hundreds of partners to find the exact right team members to work on the project based on their skill set and the value they can bring to the project.</span></p><p><span style=\"font-weight: 400;\">When we finalize the project plan, we can also confirm the project team. We build a custom team for every project.  Your project team is hand-selected to bring the greatest possible value to your project based on the deliverables. Once the team is in place, it’s time for action.</span></p>'),
(4408, 453, '_our_approach_list_1_description', 'field_5cf4ba56f411e'),
(4409, 453, 'our_approach_list_2_title', 'Action'),
(4410, 453, '_our_approach_list_2_title', 'field_5cf4ba46f411c'),
(4411, 453, 'our_approach_list_2_subtitle', 'Smooth Operation'),
(4412, 453, '_our_approach_list_2_subtitle', 'field_5cf4ba51f411d'),
(4413, 453, 'our_approach_list_2_description', '<p><span style=\"font-weight: 400;\">Our mission is to create value through operational leadership. Having created the project plan and hand-selected a specialized project team, Alpha Alias shifts gears from planning, to action. The project will be driven by a highly-skilled operational leader whose primary function is to bring value to your project.</span></p><p><span style=\"font-weight: 400;\">In their role, the operational lead will guide the team with streamlined communication and project management practices. We use industry-leading software to create a professional digital workspace, and we take a human approach to getting the most value out of individual specialists. The result is a product everyone involved feels positive about.</span></p>'),
(4414, 453, '_our_approach_list_2_description', 'field_5cf4ba56f411e'),
(4415, 453, 'our_approach_list_3_title', 'Optimization'),
(4416, 453, '_our_approach_list_3_title', 'field_5cf4ba46f411c'),
(4417, 453, 'our_approach_list_3_subtitle', 'Getting Even Better'),
(4418, 453, '_our_approach_list_3_subtitle', 'field_5cf4ba51f411d'),
(4419, 453, 'our_approach_list_3_description', '<p><span style=\"font-weight: 400;\">After your product is in use we will take a good, hard look at the numbers to make sure everything is working as we expect. During the planning phase we will identify goals that we will use in the Optimization phase to measure the success of our work. We’ll track specialized metrics and use cases and generate a report that identifies how the product is doing.</span></p><p><span style=\"font-weight: 400;\">The information we provide will include any thoughts or recommendations we feel will help bring greater value to the product. Our goals are aligned with the goals of the project and we stay true to that mission well after delivery. That’s what it means to be Project First, and that’s the commitment you get working with Alpha Alias.</span></p>'),
(4420, 453, '_our_approach_list_3_description', 'field_5cf4ba56f411e'),
(4421, 453, 'our_approach_list', '4'),
