(4597, 455, 'our_approach_list_0_title', 'Project'),
(4598, 455, '_our_approach_list_0_title', 'field_5cf4ba46f411c'),
(4599, 455, 'our_approach_list_0_subtitle', 'Project First'),
(4600, 455, '_our_approach_list_0_subtitle', 'field_5cf4ba51f411d'),
(4601, 455, 'our_approach_list_0_description', '<p><span style=\"font-weight: 400;\">Challenging the idea of the traditional digital agency, Alpha Alias applies the Project First strategy to planning activity for your project from the very beginning. We plan the project first, which then outlines the deliverables and skill sets required. From there we decide who will be involved and how the activity will look.</span></p><p><span style=\"font-weight: 400;\">Alpha Alias leads projects as a service, and in doing so we are committed to the project, rather than to a proprietary team or product. We are able to bring more value to a project because our fundamental business principle is to drive successful projects end-to-end.</span></p>'),
(4602, 455, '_our_approach_list_0_description', 'field_5cf4ba56f411e'),
(4603, 455, 'our_approach_list_1_title', 'Team'),
(4604, 455, '_our_approach_list_1_title', 'field_5cf4ba46f411c'),
(4605, 455, 'our_approach_list_1_subtitle', 'Organizing The Best'),
(4606, 455, '_our_approach_list_1_subtitle', 'field_5cf4ba51f411d'),
(4607, 455, 'our_approach_list_1_description', '<p><span style=\"font-weight: 400;\">As the project is being defined, we will gain a clear understanding of the deliverables and their nuances. Each deliverable will require specific skill sets at various levels of expertise. Alpha Alias works with hundreds of partners to find the exact right team members to work on the project based on their skill set and the value they can bring to the project.</span></p><p><span style=\"font-weight: 400;\">When we finalize the project plan, we can also confirm the project team. We build a custom team for every project.  Your project team is hand-selected to bring the greatest possible value to your project based on the deliverables. Once the team is in place, it’s time for action.</span></p>'),
(4608, 455, '_our_approach_list_1_description', 'field_5cf4ba56f411e'),
(4609, 455, 'our_approach_list_2_title', 'Action'),
(4610, 455, '_our_approach_list_2_title', 'field_5cf4ba46f411c'),
(4611, 455, 'our_approach_list_2_subtitle', 'Smooth Operation'),
(4612, 455, '_our_approach_list_2_subtitle', 'field_5cf4ba51f411d'),
(4613, 455, 'our_approach_list_2_description', '<p><span style=\"font-weight: 400;\">Our mission is to create value through operational leadership. Having created the project plan and hand-selected a specialized project team, Alpha Alias shifts gears from planning, to action. The project will be driven by a highly-skilled operational leader whose primary function is to bring value to your project.</span></p><p><span style=\"font-weight: 400;\">In their role, the operational lead will guide the team with streamlined communication and project management practices. We use industry-leading software to create a professional digital workspace, and we take a human approach to getting the most value out of individual specialists. The result is a product everyone involved feels positive about.</span></p>'),
(4614, 455, '_our_approach_list_2_description', 'field_5cf4ba56f411e'),
(4615, 455, 'our_approach_list_3_title', 'Optimization'),
(4616, 455, '_our_approach_list_3_title', 'field_5cf4ba46f411c'),
(4617, 455, 'our_approach_list_3_subtitle', 'Getting Even Better'),
(4618, 455, '_our_approach_list_3_subtitle', 'field_5cf4ba51f411d'),
(4619, 455, 'our_approach_list_3_description', '<p><span style=\"font-weight: 400;\">After your product is in use we will take a good, hard look at the numbers to make sure everything is working as we expect. During the planning phase we will identify goals that we will use in the Optimization phase to measure the success of our work. We’ll track specialized metrics and use cases and generate a report that identifies how the product is doing.</span></p><p><span style=\"font-weight: 400;\">The information we provide will include any thoughts or recommendations we feel will help bring greater value to the product. Our goals are aligned with the goals of the project and we stay true to that mission well after delivery. That’s what it means to be Project First, and that’s the commitment you get working with Alpha Alias.</span></p>'),
(4620, 455, '_our_approach_list_3_description', 'field_5cf4ba56f411e'),
