(4756, 458, '_our_approach_list_2_description', 'field_5cf4ba56f411e'),
(4757, 458, 'our_approach_list_3_title', 'Optimization'),
(4758, 458, '_our_approach_list_3_title', 'field_5cf4ba46f411c'),
(4759, 458, 'our_approach_list_3_subtitle', 'Getting Even Better'),
(4760, 458, '_our_approach_list_3_subtitle', 'field_5cf4ba51f411d'),
(4761, 458, 'our_approach_list_3_description', '<p><span style=\"font-weight: 400;\">After your product is in use we will take a good, hard look at the numbers to make sure everything is working as we expect. During the planning phase we will identify goals that we will use in the Optimization phase to measure the success of our work. We’ll track specialized metrics and use cases and generate a report that identifies how the product is doing.</span></p><p><span style=\"font-weight: 400;\">The information we provide will include any thoughts or recommendations we feel will help bring greater value to the product. Our goals are aligned with the goals of the project and we stay true to that mission well after delivery. That’s what it means to be Project First, and that’s the commitment you get working with Alpha Alias.</span></p>'),
(4762, 458, '_our_approach_list_3_description', 'field_5cf4ba56f411e'),
