(4856, 461, 'main_title', '<h1>Innovation <strong>= Defiance</strong> Of Normal</h1>'),
(4857, 461, '_main_title', 'field_5cee44aadbbd0'),
(4858, 461, 'title', ''),
(4859, 461, '_title', 'field_5cee2b06a869c'),
(4860, 461, 'slogan', 'Inspiration Fueled Action'),
(4861, 461, '_slogan', 'field_5cee33af41ed8'),
(4862, 461, 'folder_description', 'Alpha Alias challenges ordinary, allowing inspiration to drive our approach to digital products and services.'),
(4863, 461, '_folder_description', 'field_5cee33ba41ed9'),
(4864, 461, 'folder_button_title', 'Learn How'),
(4865, 461, '_folder_button_title', 'field_5cee33d641eda'),
(4866, 461, 'folder_button_url', '17'),
(4867, 461, '_folder_button_url', 'field_5cee33e041edb'),
(4868, 461, 'our_approach_list_0_title', 'Project'),
(4869, 461, '_our_approach_list_0_title', 'field_5cf4ba46f411c'),
(4870, 461, 'our_approach_list_0_subtitle', 'Project First'),
(4871, 461, '_our_approach_list_0_subtitle', 'field_5cf4ba51f411d'),
(4872, 461, 'our_approach_list_0_description', '<p><span style=\"font-weight: 400;\">Challenging the idea of the traditional digital agency, Alpha Alias applies the Project First strategy to planning activity for your project from the very beginning. We plan the project first, which then outlines the deliverables and skill sets required. From there we decide who will be involved and how the activity will look.</span></p><p><span style=\"font-weight: 400;\">Alpha Alias leads projects as a service, and in doing so we are committed to the project, rather than to a proprietary team or product. We are able to bring more value to a project because our fundamental business principle is to drive successful projects end-to-end.</span></p>'),
(4873, 461, '_our_approach_list_0_description', 'field_5cf4ba56f411e'),
(4874, 461, 'our_approach_list_1_title', 'Team'),
(4875, 461, '_our_approach_list_1_title', 'field_5cf4ba46f411c'),
(4876, 461, 'our_approach_list_1_subtitle', 'Organizing The Best'),
(4877, 461, '_our_approach_list_1_subtitle', 'field_5cf4ba51f411d'),
(4878, 461, 'our_approach_list_1_description', '<p><span style=\"font-weight: 400;\">As the project is being defined, we will gain a clear understanding of the deliverables and their nuances. Each deliverable will require specific skill sets at various levels of expertise. Alpha Alias works with hundreds of partners to find the exact right team members to work on the project based on their skill set and the value they can bring to the project.</span></p><p><span style=\"font-weight: 400;\">When we finalize the project plan, we can also confirm the project team. We build a custom team for every project.  Your project team is hand-selected to bring the greatest possible value to your project based on the deliverables. Once the team is in place, it’s time for action.</span></p>'),
(4879, 461, '_our_approach_list_1_description', 'field_5cf4ba56f411e'),
(4880, 461, 'our_approach_list_2_title', 'Action'),
(4881, 461, '_our_approach_list_2_title', 'field_5cf4ba46f411c'),
(4882, 461, 'our_approach_list_2_subtitle', 'Smooth Operation'),
(4883, 461, '_our_approach_list_2_subtitle', 'field_5cf4ba51f411d'),
(4884, 461, 'our_approach_list_2_description', '<p><span style=\"font-weight: 400;\">Our mission is to create value through operational leadership. Having created the project plan and hand-selected a specialized project team, Alpha Alias shifts gears from planning, to action. The project will be driven by a highly-skilled operational leader whose primary function is to bring value to your project.</span></p><p><span style=\"font-weight: 400;\">In their role, the operational lead will guide the team with streamlined communication and project management practices. We use industry-leading software to create a professional digital workspace, and we take a human approach to getting the most value out of individual specialists. The result is a product everyone involved feels positive about.</span></p>'),
(4885, 461, '_our_approach_list_2_description', 'field_5cf4ba56f411e'),
(4886, 461, 'our_approach_list_3_title', 'Optimization'),
(4887, 461, '_our_approach_list_3_title', 'field_5cf4ba46f411c'),
